import React from "react";
import "../../Styles/Shared/NavbarResp.scss";

function NavbarResp() {
  return (
    <div className='navbarResp'>
      <div className='navResp__header'>
        <div className='navResp__logo'></div>
        <h3>Pay2Gate</h3>
      </div>
    </div>
  );
}

export default NavbarResp;
